const MultiForm = formType => {
	return (
		<div className="multi-form">
			<form>
				<progress max="4" value="1">
					<div className="slide">
						(step 1 of 7)
						<h2>test</h2>
					</div>
				</progress>
				<progress max="4" value="2">
					<div className="slide">
						(step 1 of 7)
						<h2>test2</h2>
					</div>
				</progress>
			</form>
		</div>
	);
};

export default MultiForm;
